//App.js
import React from "react";
import Login from "./components/Login";

import {
    BrowserRouter as Router,
    Route,
    Link,
    Routes,
    Outlet,
} from "react-router-dom";
import { Navbar, Nav } from "react-bootstrap";

function NotFound() {
    return (
        <div>
            <h2>404 Not Found</h2>
            <p>Lo sentimos la pagina web que esta tratando de cargar no existe.</p>
        </div>
    );
}

function get_nombre() {
    let nombre = (localStorage.getItem('nombre'));
    if (nombre.length > 1) {
        nombre = "Nombre del usuario: " + nombre;
    }
    return nombre;
}

function get_profile() {
    try {
        if (localStorage.getItem('nombre').length > 0) {
            <Nav.Link as={Link} to="/salir">
                Salir
            </Nav.Link>
        } else {
            <Nav.Link as={Link} to="/Login">
                Iniciar session
            </Nav.Link>
        }
    } catch (error) {

    }
}

function App() {

    return (
        <Router>
            <Navbar bg="light" expand="lg">
                <Navbar.Brand>
                    <h1 style={{ color: "green" }}>Tp de Elizabeth Denett</h1>

                </Navbar.Brand>

                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto">
                        <Nav.Link as={Link} to="/" exact>
                            Inicio
                        </Nav.Link>
                        {get_profile()}
                    </Nav>

                </Navbar.Collapse>
            </Navbar>
            <div className="container mt-4">
                <Routes>
                    <Route path="/" element={<Outlet />}>

                        <Route path="/Login" element={<Login />} />
                        <Route path="*" element={<NotFound />} />
                    </Route>
                </Routes>
            </div>
        </Router>
    );
}
export default App;
